import React from "react";
// import CreateCategory from "./CreateCategory";
import { ButtonStyled } from "../../common/Button/Button.styled";

export default function CategoryList({ categories = [] }) {
  return (
    <div>
      {/* <CreateCategory> */}
      {categories.length
        ? categories.map(category => (
            <div key={category.id}>
              <hr />
              <ButtonStyled buttonStyle={"danger"}>Delete</ButtonStyled>
              <ButtonStyled buttonStyle={"primary"}>Update</ButtonStyled>
            </div>
          ))
        : null}
      {/* </CreateCategory> */}
      <ButtonStyled type="button" buttonStyle="add">
        <AnchorLinkStyled>Add</AnchorLinkStyled>
      </ButtonStyled>
    </div>
  );
}
